import React, { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import SearchBox from './SearchBox';
import { logout } from '../actions/userActions';
import { FaHome, FaGamepad, FaShoppingCart, FaUser, FaHeart } from 'react-icons/fa';
import { GiSwordsEmblem } from 'react-icons/gi';
import { SiTwitch } from 'react-icons/si';
import Avatar from '../assets/Bite-sized logo.png';
import Avatar2 from '../assets/Bite lettering.png';

import { faHeart } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { FaFileInvoice } from 'react-icons/fa';
import { listProductDetails, createProductReview } from '../actions/productActions';
import { PRODUCT_CREATE_REVIEW_RESET } from '../constants/productConstants';
import { FaComments } from 'react-icons/fa';
import { Helmet } from "react-helmet";

function Header({ match, history}) {

  const dispatch = useDispatch();
  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const logoutHandler = () => {
    dispatch(logout());
  };

  return (
    <header>
       {/* <Helmet>
        <title>POPSICCLE</title>
        <link rel="icon" type="image/png" href="https://imgur.com/XDaKYpK.png" sizes="16x16" />
      </Helmet> */}
      <Navbar bg="dark" variant="dark" expand="lg" style={{ height: '125px' }}>
        <Container>
          <LinkContainer to="/">
          <Navbar.Brand>
  <img src={Avatar} className="d-inline-block align-top" alt="BITE-SIZED Logo" style={{ width: '60px', height: '60px', marginTop: '40px' }} />
  <img src={Avatar2} className="d-inline-block align-top" alt="BITE-SIZED Logo" style={{ width: '150px', height: '150px', marginLeft: '5px' }} />
</Navbar.Brand>


          </LinkContainer>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">

            <Nav className="me-auto">
              <LinkContainer to="/">
                <Nav.Link>

                  News
                </Nav.Link>
              </LinkContainer>





  <LinkContainer to="/plan">
  <Nav.Link>

{/* start of subscription */}

  <Col md={6}>
              <ListGroup >

         {loadingOrders ? (
  <Loader /> 
) : errorOrders ? ( 
  <Message variant='danger'>{errorOrders}</Message> 
) : ( 
  orders.map(order => (


    <div key={order.id}>

      <h2>
      {order.isPremium && order.isBought && (
          <div>

<ListGroup.Item>
<div >
<Card>

          <h2 className='text-center'> Comments</h2>
          {song.reviews.length === 0 && <Message>No Comments</Message>}
          <ListGroup variant="flush">
            {song.reviews.map((review) => (
              <ListGroup.Item key={review._id}>
                <h5>{review.name}</h5>
                {/* <Rating value={review.rating} color={"#f8e825"} /> */}
                <p>{review.createdAt.substring(0, 10)}</p>
                <p>{review.comment}</p>
              </ListGroup.Item>
            ))}
            <ListGroup.Item>
              <h2>Write a Comment</h2>
              {successSongReview && (
                <Message variant="success">
                  Comment submitted successfully
                </Message>
              )}
              {loadingSongReview && <Loader />}
              {errorSongReview && (
                <Message variant="danger">{errorSongReview}</Message>
              )}
              {userInfo ? (
                <Form onSubmit={submitHandler}>
                  <Form.Group controlId="rating">
                    {/* <Form.Label>Rating</Form.Label> */}
                    {/* <Form.Control
                      as="select"
                      value={rating}
                      onChange={(e) => setRating(e.target.value)}
                    >
                      <option value="">Select...</option>
                      <option value="1">1 - Poor</option>
                      <option value="2">2 - Fair</option>
                      <option value="3">3 - Good</option>
                      <option value="4">4 - Very Good</option>
                      <option value="5">5 - Excellent</option>


                                                        </Form.Control> */}
                                                    </Form.Group>

                                                    <Form.Group controlId='comment'>
                                                        <Form.Label></Form.Label>
                                                        <Form.Control
                                                            as='textarea'
                                                            row='5'
                                                            value={comment}
                                                            onChange={(e) => setComment(e.target.value)}
                                                        ></Form.Control>
                                                    </Form.Group>

                                                    <Button
                                                        disabled={loadingSongReview}
                                                        type='submit'
                                                        variant='primary'
                                                    >
                                                        Submit
                                                    </Button>

                                                </Form>
                                            ) : (
                                                    <Message variant='info'>Please <Link to='/login'>login</Link> to write a comment</Message>
                                                )}
                                        </ListGroup.Item>
                                    </ListGroup>

      </Card>
</div>

            </ListGroup.Item>



          </div>
        )}
      </h2>
    </div>
  ))

)}

</ListGroup>

</Col>
{/* End of subscription */}

      Go Premium
      </Nav.Link>

  </LinkContainer>           















<NavDropdown title={<span>Topics</span>}> 
  <LinkContainer to="/liked">
    <NavDropdown.Item>
    {/* <FontAwesomeIcon icon={faHeart} className="me-2" />      Liked Songs */}
    </NavDropdown.Item>
  </LinkContainer>           


  <LinkContainer to="/playlistsongs">

  <NavDropdown.Item>
    {/* <FaFileInvoice className="me-2" /> */}
    Gaming
  </NavDropdown.Item>
</LinkContainer>


</NavDropdown>





            </Nav>


            <Nav>


      {userInfo ? (
                <NavDropdown title={userInfo.name} id="username">
                  <LinkContainer to="/profile">
                    <NavDropdown.Item>
                      <FaUser className="me-2" />
                      Profile
                    </NavDropdown.Item>
                  </LinkContainer>

                  <NavDropdown.Item onClick={logoutHandler}>
                    Logout
                  </NavDropdown.Item>
                </NavDropdown>
              ) : (
                <LinkContainer to="/login">
                  <Nav.Link>
                    <FaUser className="me-2" />
                    Login
                  </Nav.Link>
                </LinkContainer>
              )}

{userInfo && userInfo.isAdmin && (
                                <NavDropdown title='Admin' id='adminmenue'>
                                    <LinkContainer to='/admin/userlist'>
                                        <NavDropdown.Item>Users</NavDropdown.Item>
                                    </LinkContainer>

                                    <LinkContainer to='/admin/productlist'>
                                        <NavDropdown.Item>Products</NavDropdown.Item>
                                    </LinkContainer>

                                    <LinkContainer to='/admin/orderlist'>
                                        <NavDropdown.Item>Orders</NavDropdown.Item>
                                    </LinkContainer>

                                </NavDropdown>
                            )}
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
}

export default Header;
